description:
French Resistance activist Andre Devigny is imprisoned by the Nazis, and devotes his waking hours to planning an elaborate escape. Then, on the same day, he is condemned to death, and given a new cellmate. 
Should he kill him, or risk revealing his plans to someone who may be a Gestapo informer? 

